import { makeStyles } from "@material-ui/core/styles";
const NavBarMakeStyle = makeStyles((theme) => ({
  AppBar: {
    backgroundColor: "#ffff",
  },
  logo: {
    marginLeft: 30,
  },
  tabs: {
    marginLeft: "auto",
    fontFamily: "Roboto",
    paddingRight: "30px",
  },
  tabItems: {
    color: "#5d89a2",
    textTransform: "upperCase",
    fontWeight: "300",
    fontSize: "0.90em",
    minWidth: 5,
    marginLeft: "8px",
  },
  tabContainer: {
    marginLeft: "auto",
    marginRight: "100px",
  },
  signButton: {
    backgroundColor: "#04091e",
    textTransform: "none",
    color: "white",
    boxShadow: theme.shadows[0],
    fontSize: "18px",
    paddingLeft: "25px",
    paddingRight: "25px",
    borderRadius: "10px",
    marginLeft: "15px",
    "&:hover": {
      backgroundColor: "#2c7eeb",
    },
  },
}));

export default NavBarMakeStyle;
